            if (responseAdditionalDataInstallments._InstallmentPaymentDataPaymentOptionsOption.IsSet)
                if (responseAdditionalDataInstallments.InstallmentPaymentDataPaymentOptions != null)
                    writer.WriteString("installmentPaymentData.paymentOptions", responseAdditionalDataInstallments.InstallmentPaymentDataPaymentOptions);

            if (responseAdditionalDataInstallments._InstallmentsValueOption.IsSet)
                if (responseAdditionalDataInstallments.InstallmentsValue != null)
                    writer.WriteString("installments.value", responseAdditionalDataInstallments.InstallmentsValue);
        }
    }
}
